INSERT INTO `apartment` (`ID`, `title`, `description`, `place`, `img`, `price`) VALUES
(1, 'Sarajevo Daily Apartments', 'Hotel Lavina Jahorina offers luxury accommodation in rooms and suites with amenities that guarantee a high level of comfort. All rooms and suites have internet access, LCD TV, telephone, safe and mini bar.', 'Sarajevo - Skenderija', 0x68747470733a2f2f732d65632e627374617469632e636f6d2f696d616765732f686f74656c2f6d617831303234783736382f3331312f33313135343833302e6a7067, 50),
(2, 'BA Apartments', 'Set within 700 metres of Latin bridge and 1 km of Bascarsija Street in Sarajevo, BA Apartments offers accommodation with free WiFi, seating area and flat-screen TV.', 'Sarajevo - Cobanija', 0x68747470733a2f2f742d65632e627374617469632e636f6d2f696d616765732f686f74656c2f6d617831303234783736382f3131302f3131303439383239382e6a7067, 70),
(3, 'Exclusive Apartments Bistrik', 'Surrounded by garden boasting city views, Exclusive Apartments Bistrik is located 500 metres from the centre of Sarajevo. It provides elegantly decorated interiors with air conditioning and free Wi-Fi. Free private parking is provided.', 'Sarajevo - Bistrik', 0x687474703a2f2f636f6e636f757273617566696c64657370616765732e636f6d2f77702d636f6e74656e742f75706c6f6164732f323031342f31322f646f776e746f776e2d6c75787572792d61706172746d656e742d736172616a65766f2d342e6a7067, 65),
(4, 'Apartmani Massimo', 'ocated a 10-minute walk from the Ferhadija Promenade Street, in Sarajevo, Apartments Massimo features free WiFi throughout. The air-conditioned apartments come with a kitchen and a bathroom.', 'Sarajevo - Skenderija', 0x68747470733a2f2f742d65632e627374617469632e636f6d2f696d616765732f686f74656c2f6d617831303234783736382f3738312f37383134343933372e6a7067, 150),
(5, 'Apartments Emily', 'Offering free WiFi and free private parking, Apartments Emily enjoys a central location in Sarajevo.', 'Sarajevo - Centar', 0x68747470733a2f2f732d65632e627374617469632e636f6d2f696d616765732f686f74656c2f6d61783530302f3835372f38353739373631362e6a7067, 120),
