INSERT INTO `cars` (`ID`, `title`, `type`, `description`, `people`, `year`, `price`, `img`, `driver`) VALUES
(1, 'AUDI', 'AUDI A6', 'From the widened single frame, to the side air intakes with sporty chrome trims, to the narrow headlights – the progressive nature A6 Saloon\'s front gives a great impression at first sight.', ' Max People: From 2 to 5', ' Model Year: 2016', 80, 'http://4-photos7.motorcar.com/used-2016-audi-a6-certifieda620tquattropremiumplusawdcamnavi-1186-16043980-2-1024.jpg', 'No driver'),
(2, 'MERCEDES', 'MERCEDES S Class', 'Every mountain range has its pinnacle. Every sport, its champion. Every breakthrough, its inventor.', ' Max People: From 2 to 6', ' Model Year: 2018', 150, 'https://i.gaw.to/vehicles/photos/09/22/092280_2018_mercedesbenz_Classe_S.jpg?460x287', 'Comes with driver'),
(3, 'BMW', 'BMW 7', 'The new BMW 7 Series represents our take on contemporary luxury. We consider technical innovation and a high quality of all details as indispensable as the emotional form language and the atmosphere of wellbeing of the interior.', ' Max People: From 2 to 6', ' Model Year: 2015', 69, 'http://3-photos7.motorcar.com/used-2015-bmw-7_series-certified740imsportpackage-1186-16700228-47-1024.jpg', 'No driver'),
(4, 'FORD', 'Ford Focus', 'The Focus ST (image shown) is sporty and fun – from its body kit with lower valances and rocker moldings to the performance-inspired rear spoiler and unique bright-tipped center-exit exhaust.', ' Max People: From 2 to 5', ' Model Year: 2017', 69, 'http://2017god.org/wp-content/uploads/Ford-Focus-2017.jpg', 'Comes with driver'),
(5, 'VOLKSWAGEN', 'VOLKSWAGEN TOUAREG', 'The new Touareg offers a truly digital cockpit with a ground-breaking 15-inch Innovision glass display screen which can be controlled by voice, gesture or touch.', ' Max People: From 2 to 6', ' Model Year: 2014', 120, 'https://file.kbb.com/kbb/vehicleimage/housenew/480x360/2014/2014-volkswagen-touareg-frontside_vttouareg141.jpg', 'Comes with driver'),
(6, 'MERCEDES', 'Mercedes V Class', 'When you need to convert it into a makeshift van it’s a faff, too - there’s no such convenience as seats that fold flat into the floor. With the V-Class it’s brawn that’s required. Oh, and space to leave the five chairs while they’re not in the car.', ' Max People: From 5 to 11', 'Model Year: 2017', 119, 'https://i.ytimg.com/vi/Ir24CDMBlfU/maxresdefault.jpg', 'No driver'),
(7, 'MERCEDES', 'Mercedes Vito', 'The new Vito creates an assertive and unmistakable impression. For the new Vito, however, design is not an end in itself. With a Cd value of 0.32 wind resistance is very low.', ' Max People: From 5 to 10', 'Model Year: 2015', 99, 'https://i.ytimg.com/vi/oT5qVGUbkCM/maxresdefault.jpg', 'Comes with driver'),
(0, '', '', '', '', '', 0, '', '');
