INSERT INTO `hotel` (`ID`, `title`, `description`, `place`, `img`) VALUES
(1, 'Malak Regency Hotel', 'This unique five star hotel is ideal for business guests\r\nas well as for those who want to enjoy and relax in the green oasis of Ilidža.', 'Sarajevo - Ilidza', 0x68747470733a2f2f7374617469632e6b6c69782e62612f6d656469612f696d616765732f76696a657374692f3136313232393038312e315f6d6e2e6a70673f763d31),
(2, 'Al Shiddi - SWissHotel', 'Escape commitments and live in the moment. Enjoy fine food, travel and refine your sense of culture. Reap the reward of hard work and invest in the things you care about most. Right here, right now!', 'Sarajevo - Marijin Dvor', 0x687474703a2f2f7368696464692e636f6d2f77702d636f6e74656e742f75706c6f6164732f323031372f30322f35303038325f37313630305f557a56744b592e6a7067),
(3, 'Krone Hotel', 'Hotel ‘Krone’ /Crown is placed in the most beautiful part of Sarajevo, the area that had been populated 5000 ago, the ancient Roman province. This place under sun, used to cure by its miraculous springs and it was named Ilidža. In Turkish Ilidža means a remedy, something that brings health.', 'Sarajevo - Ilidza', 0x687474703a2f2f7669736974736172616a65766f2e62612f77702d636f6e74656e742f75706c6f6164732f323031372f30362f686f74656c692d6b726f6e652d363430783432372e6a7067),
(4, 'Hotel Europe', 'Located in the heart of the city of Sarajevo, only a few steps away from the tourist old town core, this Austro-Hungarian building captures its attention with its luxurious look.\r\n', 'Sarajevo - Stari Grad', 0x68747470733a2f2f6d656469612d63646e2e7472697061647669736f722e636f6d2f6d656469612f70686f746f2d732f30322f66322f35322f31332f686f74656c2d6575726f70652d736172616a65766f2e6a7067),
(5, 'Hotel President', 'The ideal location of the hotel is just one of the advantages of this hotel and will surely provide you with an experience that you will surely remember and want to experience again.\r\n', 'Sarajevo - Latinska Cuprija', 0x68747470733a2f2f6578702e63646e2d686f74656c732e636f6d2f686f74656c732f31323030303030302f31313833303030302f31313832353030302f31313832343938362f64323161373565355f7a2e6a7067),
(6, 'Radon Plaza', 'All facilities, amenities, services and staff will make the stay in the hotel comfortable. Hotel operates to the highest HACCP and ISO standards.', 'Sarajevo - Nedzarici', 0x68747470733a2f2f7777772e686f7374656c7363656e7472616c2e636f6d2f706963732f32373831322f3032373831322d313336303933323631372e6a7067),
(7, 'Hotel Konjic', 'The Congress & Recreation Center Hotel & Resort is categorized with four stars according to hotel categorization standards. Garden City - A New Rhythm of Living! Welcome at all times!\r\n', 'Konjic - Garden City', 0x68747470733a2f2f732d65632e627374617469632e636f6d2f696d616765732f686f74656c2f6d617831323830783930302f3738332f373833383733312e6a7067),
(8, 'Hotel Konak', 'Located in the heart of the city of Konjic, only a few steps away from the tourist old town core, this Austro-Hungarian building captures its attention with its luxurious look.\r\n', 'Konjic', 0x68747470733a2f2f69312e77702e636f6d2f74757a6c616e736b692e62612f77702d636f6e74656e742f75706c6f6164732f323031352f30372f686f74656c6b6f6e616b2e6a70673f6669743d3830302532433533342673736c3d31),
(9, 'Hotel Bristol', 'Hotel \"Bristol\" Mostar, thanks to its long tradition, high quality offer and services, won the \"Golden Catering Kruna\" in the category: BEST HOTEL WITH 4 * TO 50 ACCOMMODATION UNITS \".\r\n', 'Mostar - Centar', 0x68747470733a2f2f7777772e62726973746f6c2e62612f736c696b652f312e6a7067),
(10, 'Hotel Mostar', 'Hotel \"Mostar\", a newly built 4-star hotel, is located in the very center of the city, only a 15-minute walk from the Old Town Square and 10 minutes from the bus or train station.\r\n', 'Mostar', 0x687474703a2f2f7777772e67646a657a6176696b656e642e62612f77702d636f6e74656e742f75706c6f6164732f323031372f30352f686f74656c6d6f737461722d312e6a7067),
(11, 'Hotel Turist', 'Featuring free WiFi throughout the property, Hotel Turist 98 offers accommodation in Jajce. Guests can enjoy the on-site restaurant. Free private parking is available on site.', 'Jajce', 0x687474703a2f2f7777772e686f74656c2d74757269737439382e636f6d2f696d616765732f55316e65772e6a7067),
(12, 'Hotel Han', 'Hotel HAN is located in the heart of Bjelasnica with an incredible view of the ski slope and the beautiful landscape. The hotel is located just 25 KM away from Sarajevo.\r\n', 'Bjelasnica', 0x68747470733a2f2f7777772e736d657374616a6e616b6c696b2e636f6d2f67616c6572696a612f686f74656c2d68616e2e6a7067),
(13, 'Hotel Lavina', 'Hotel Lavina Jahorina offers luxury accommodation in rooms and suites with amenities that guarantee a high level of comfort. All rooms and suites have internet access, LCD TV, telephone, safe and mini bar.', 'Jahorina', 0x687474703a2f2f7777772e6c6176696e612e62612f70686f746f2f67616c6c6572792f686f74656c2f6c617267652f3030312e6a7067),
(0, '', '', '', '');
